import './App.css';
import Person from './Person';
import Button from './Button';
import Header from './Header';

function App() {
  return (
    <div className="App">
      <Person name ="Sachin" age="23"/>
      <Button text="Click Me" onClick={()=> window.alert("Button Clicked")}/>
    </div>
  );
}

export default App;
